INSERT INTO gallery_gallerypage (id, title, subtitle, bottom_title, bottom_text, banner) VALUES (1, '<h2>Галерея<br class="title_br">работ</h2>', 'Гарантированное качество', 'Мы работаем по указу №240', '<p>Строительство частного дома в кредит по указу №240 – выгодно, но непросто. Следует знать и учесть множество нюансов: строить жилье в деревне или черте города, будут ли дополнительные расходы, как определится с проектом  и составить смету для банка.</p>INSERT INTO home_about (id, title, subtitle, text, image) VALUES (1, '<h2>Кратко <br class="title_br" /> о нас</h2>', 'Только факты', 'Существует большое количество строительных компаний, которые предлагают разные виды услуг по ремонту, строительству объектов разного назначения. Одной из них является компания «ТимВитСтрой». Строительная отрасль является одной из самых сложных сфер деятельности. Она связана с работами на высоте, часто сопряжена с использованием вспомогательных устройств, опыт и образование при этом является неотъемлемой частью строительных  процессов . Поэтому, прежде чем решиться производить строительно-монтажные  работы самостоятельно, нужно хорошо подумать, стоит ли это делать. Доверьте свои  планы по строительству нам!INSERT INTO home_head (id, title, image_1, image_2) VALUES (1, 'Строительство домов, коттеджей, гаражей, дач в Гомеле и области, в т.ч. по указу 240', 'home/slider-1.jpg', 'home/slider-2.jpg');
INSERT INTO home_service (id, title, subtitle, text, service_image_1, service_title, service_text, link_text, service_image_2) VALUES (1, '<h2>Наши <br class="title_br" /> услуги</h2>', '<h6>Соблюдение технологий <br class="sub_br" /> плюс четкая организаци', '<p>Мы предлагаем полный комплекс по строительным услугам, реализуемые в чётком соответствии с предпочтениями заказчика:</p>INSERT INTO home_service (id, title, subtitle, text, service_image_1, service_title, service_text, link_text, service_image_2) VALUES (2, '', '', '', 'shovel-48.png', 'Земляные работы', 'Эти работы включают в себя разработку грунта, перемещение, укладку и уплотнение.', 'Раздел "Услуги"', 'shovel-48-hover.png');
INSERT INTO home_service (id, title, subtitle, text, service_image_1, service_title, service_text, link_text, service_image_2) VALUES (3, '', '', '', 's-icon-1.png', 'Фундамент, стены', 'Выбор фундамента зависит от сейсмичности, грунтов и архитектурных решений.', 'Раздел "Услуги"', 's-icon-hover-1.png');
INSERT INTO home_service (id, title, subtitle, text, service_image_1, service_title, service_text, link_text, service_image_2) VALUES (4, '', '', '', 'roof-48.png', 'Кровля', 'Главной функцией кровли является защита дома от атмосферных воздействий.', 'Раздел "Услуги"', 'roof-48-hover.png');
INSERT INTO home_service (id, title, subtitle, text, service_image_1, service_title, service_text, link_text, service_image_2) VALUES (5, '', '', '', 's-icon-6.png', 'Инженерные сети', 'Инженерные сети обеспечивают дом теплом, электричеством, газом, водой, связью и т.д.', 'Раздел "Услуги"', 's-icon-hover-6.png');
INSERT INTO home_service (id, title, subtitle, text, service_image_1, service_title, service_text, link_text, service_image_2) VALUES (6, '', '', '', 's-icon-5.png', 'Отделка', 'Отделка придает помещению законченный вид, отвечающий вкусам хозяина..', 'Раздел "Услуги"', 's-icon-hover-5.png');
INSERT INTO home_testimonial (id, name, testimonial, image) VALUES (4, 'Василий Усов', 'В сентябре обратился в "ТимВитСтрой" с заданием отремонтировать капитальный гараж. Выполненными работами и ценой остался доволен. Все четко, аккуратно, профессионально. Рекомендую.', 'home/garazh.jpg');
INSERT INTO projects_indprojectpage (id, banner, title, subtitle, text_title, text, image) VALUES (1, 'banners/proek_banner_ekfzEZU.jpg', 'Индивидуальное проектирование', 'Оптимальное решение', 'Индивидуальное проектирование', 'Компания «ТимВитСтрой» занимается разработкой индивидуальных проектов домов и коттеджей в Гомеле и области, а также доработкой типовых проектов по Ваши требования. В нашем штате есть опытные архитекторы, проектировщики и инженеры, которые разработают проект долговечного, энергоэффективного и красивого дома.INSERT INTO projects_projectdetail (id, name, description, section_id, slug, article_name, article_photo, article_text, article_thumb, image) VALUES (1, 'Дом 60 кв.м.', 'Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusan-tium doloremque laudantium', 1, 'dom-60-kvm', 'Проект дома площадью 60 кв.м. в Турове', '10.jpg', '<p>Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione.</p>INSERT INTO projects_projectdetail (id, name, description, section_id, slug, article_name, article_photo, article_text, article_thumb, image) VALUES (2, 'Дом 75 кв.м.', 'Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusan-tium doloremque laudantium', 1, 'dom-75-kvm', 'Проект дома площадью 75 кв.м. в Речице', '1.jpg', 'Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione.INSERT INTO projects_projectdetail (id, name, description, section_id, slug, article_na