INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (1, 'Проектирование', 'icons/s2-icon-2.png', 'icons/s2-icon-hover-2.png', 'services/p1b.jpg', '', 'services/p2b.jpg', 'services/p3b.jpg', 'services/p4b.jpg', 'services/p5b.jpg', '', '', '', '', 'Стройка начинается с проекта. Без него представление будущего хозяина о доме может не совпасть с реальностью.', 'proektirovanie', 'Постройка здания начинается с архитектурно-строительного проектирования. Так называют планирование облика строения, составление технической документации, которая будет описывать все его особенности. Без такого комплекта представления будущего домовладельца о том, каким будет его жилье, могут не совпасть с реальностью.', '', 'Проектирование домов, коттеджей, дач', '', 'banners/proek_banner.jpg', 'services/p1s.jpg', '', 'services/p2s.jpg', 'services/p3s.jpg', 'services/p4s.jpg', 'services/p5s.jpg', '', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (2, 'Земляные работы', 'icons/shovel-80.png', 'icons/shovel-80-hover.png', 'services/z1b.jpg', '', 'services/z2b.jpg', 'services/z3b.jpg', 'services/z4b.jpg', 'services/z5b.jpg', 'services/z6b.jpg', '', '', '', 'Включают в себя разработку грунта, перемещение, укладку и уплотнение; входят в состав строительных работ.', 'zemlyanye-raboty', 'Работы, включающие в себя разработку грунта, перемещение, укладку и уплотнение; входят в состав строительных работ. Все такие работы сводятся к тому, что в грунте либо делается выемка, либо насыпается дополнительный грунт. В первом случае выемка, которая отрывается только для добычи грунта, будет называться резервом, а насыпь — отвалом или кавальером. Поэтому цель земляных работ можно определить как создание инженерных сооружений из грунта. Грунты на прямую влияют при выборе фундамента.', '', 'Земляные работы в строительстве', '', 'banners/zemlyan.jpg', 'services/z1s.jpg', '', 'services/z2s.jpg', 'services/z3s.jpg', 'services/z4s.jpg', 'services/z5s.jpg', 'services/z6s.jpg', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (3, 'Устройство фундамента', 'icons/foundation_80.png', 'icons/foundation_80_hover.png', 'services/f1b.jpg', '', 'services/f2b.jpg', 'services/f3b.jpg', 'services/f4b.jpg', 'services/f5b.jpg', '', '', '', '', 'Выбор фундамента зависит от сейсмичности местности, грунтов и архитектурных решений.', 'ustrojstvo-fundamenta', 'Фундамент – это строительная  несущая конструкция , часть  здания и  сооружения,  которая принимает все нагрузки от вышележащих конструкций и распределяет их по основанию. Фундамент, как правило, изготавливается из бетона или железобетона, а также камня, стали или дерева (стальных или деревянных свай). Фундаменты, как правило, закладываются ниже глубины промерзания грунта, чтобы предотвратить выпучивание. На непучинистых грунтах при строительстве лёгких деревянных построек применяют мелкозаглубленные фундаменты (фундамент, находящийся выше уровня промерзания грунта). Такой тип фундамента подходит в основном для небольших садовых  домиков, летних бань и хозяйственных построек. Для строительства зданий применяются ленточные, отдельно стоящие столбчатые, свайные и плитные или комбинированные фундаменты. Они бывают сборные (сплошные монолитные или стаканного типа), монолитные и сборно-монолитные. Выбор фундамента зависит от сейсмичности местности, залегающих в основании грунтов и архитектурных решений. Изготовление фундамента из бетона возможно при температуре выше 5°С, что накладывает существенные ограничения на сезонность выполнения строительных работ. Проведение работ при более низких температурах возможно с использованием технологии электропрогрева.', '', 'Устройство фундамента', '', 'banners/fundam.jpg', 'services/f1s.jpg', '', 'services/f2s.jpg', 'services/f3s.jpg', 'services/f4s.jpg', 'services/f5s.jpg', '', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (4, 'Кладка стен, перегородок', 'icons/s2-icon-4.png', 'icons/s2-icon-hover-4.png', 'services/k1b.jpg', '', 'services/k2b.jpg', 'services/k3b.jpg', 'services/k4b.jpg', 'services/k5b.jpg', '', '', '', '', 'Стена — структурный элемент в архитектуре и строительстве, создающий внешний периметр здания.', 'kladka-sten-peregorodok', 'Стена — структурный элемент в архитектуре и строительстве, создающий внешний периметр здания или помещения в виде вертикальной ограждающей конструкции, отделяющей помещение  от окружающего пространства или соседних комнат. Перегородки - внутренние стены, воспринимающие нагрузки только от собственного веса и ветра (при открытых оконных проёмах) в пределах одного этажа при высоте его не более 6 м; при большей высоте этажа стены этого типа условно относятся к самонесущим.', '', 'Кладка стен и перегородок в доме', '', 'banners/kladka.jpg', 'services/k1s.jpg', '', 'services/k2s.jpg', 'services/k3s.jpg', 'services/k4s.jpg', 'services/k5s.jpg', '', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (5, 'Монолитный пояс', 'icons/poyas_80.png', 'icons/poyas_80_hover.png', 'services/m1b.jpg', '', 'services/m2b.jpg', 'services/m3b.jpg', 'services/m4b.jpg', 'services/m5b.jpg', 'services/m6b.jpg', '', '', '', 'Монолитный пояс — балка из железобетона, которую организовывают над фундаментом и на стенах из кладки.', 'monolitnyj-poyas', 'Монолитный пояс — балка из железобетона, которую организовывают над фундаментом и на стенах из кладки. Монолитность элемента гарантируется установкой временной опалубочной системы — конструкции из щитов и фиксирующих элементов для заливки жидкого бетонного раствора, в которой он застывает.', '', 'Устройство монолитного пояса', '', 'banners/poyas.jpg', 'services/m1s.jpg', '', 'services/m2s.jpg', 'services/m3s.jpg', 'services/m4s.jpg', 'services/m5s.jpg', 'services/m6s.jpg', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (6, 'Межэтажные перекрытия', 'icons/perekrytie_80.png', 'icons/perekrytie_80_hover.png', 'services/per-1b.jpg', '', 'services/per-2b.jpg', 'services/per-3b.jpg', 'services/per-4b.jpg', 'services/per-5b.jpg', '', '', '', '', 'Деревянные перекрытия делают из балок, заполнения и отделочного слоя. Железобетонные - из силикатного бетона.', 'mezhetazhnye-perekrytiya', 'Деревянные перекрытия состоят, как правило, из балок, являющихся несущей частью конструкции пола, межбалочного заполнения, предназначенного для звукоизоляции или теплоизоляции, и отделочного слоя потолка. Верхним слоем межбалочного объема обычно являются звуко- и теплоизоляционные заполнители, нижним — поддерживающий изоляцию, называемый накатом. В качестве деревянных балок перекрытия чаще применяют брусья из дерева прямоугольного сечения.             Железобетонные плиты перекрытия, которые производятся из силикатного бетона, используются для выполнения несущей части перекрытия и покрытий  зданий различного назначения. Плиты перекрытия — это железобетонные изделия, которые предназначены для обустройства межэтажных и чердачных  перекрытий.', '', 'Устройство межэтажных перекрытий', '', 'banners/perekryt.jpg', 'services/per-1s.jpg', '', 'services/per-2s.jpg', 'services/per-3s.jpg', 'services/per-4s.jpg', 'services/per-5s.jpg', '', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (7, 'Устройство кровли', 'icons/krovlya_80.png', 'icons/krovlya_80_hover.png', 'services/kr-1b.jpg', '', 'services/kr-2b.jpg', 'services/kr-3b.jpg', 'services/kr-4b.jpg', 'services/kr-5b.jpg', '', '', '', '', 'Главной функцией кровли является защита внутренних помещений от атмосферных осадков и воздействий.', 'ustrojstvo-krovli', 'Кровля — верхний элемент покрытия здания, подвергающийся атмосферным воздействиям. Главной её функцией является защита внутренних помещений от атмосферных осадков и воздействий. Главными требованиями к кровле являются лёгкость, долговечность, экономичность в изготовлении и эксплуатации.    Кровля состоит из несущего слоя (обрешётки, сплошного настила, стяжки), который держится на несущей конструкции крыши (стропила), слоев изоляции (гидроизоляция, теплоизоляция, пароизоляция) и покрытия, охраняющего изоляцию от воздействия окружающей среды. Кровля может быть в разной степени утеплена. С внутренней стороны конструкций крыши может применяться пароизоляция, чтобы предотвратить попадания тёплого воздуха в утеплитель, что может привести к образованию конденсата в связи с достижением точки росы в нём.   Чтобы с кровли на плоских крышах эффективно скатывалась вода, они имеют небольшой уклон.   Так как кровля напрямую подвергается воздействиям окружающей среды, она должна быть водонепроницаемой, влагоустойчивой, стойкой к агрессивным химическим веществам, солнечной радиации и резким перепадам температур, не должна подвергаться короблению, растрескиванию, не должна разрушаться, нагревшись от солнца.', '', 'Устройство кровли дома', '', 'banners/krovlya.jpg', 'services/kr-1s.jpg', '', 'services/kr-2s.jpg', 'services/kr-3s.jpg', 'services/kr-4s.jpg', 'services/kr-5s.jpg', '', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (8, 'Инженерные сети', 'icons/s2-icon-6.png', 'icons/s2-icon-hover-6.png', 'services/set-1b.jpg', '', 'services/set-2b.jpg', 'services/set-3b.jpg', 'services/set-4b.jpg', 'services/set-5b.jpg', '', '', '', '', 'Инженерные сети обеспечивают дом теплом, электричеством, газом, водой, связью и другими удобствами.', 'inzhenernye-seti', 'Инженерные сети – это комплекс технического оборудования и сооружений, который обеспечивает объект тепловыми, электрическими, газовыми коммуникациями, системами водоснабжения и водоотведения (канализация), системы сигнализации, связи и т.д.', '', 'Устройство инженерных сетей', '', 'banners/seti.jpg', 'services/set-1s.jpg', '', 'services/set-2s.jpg', 'services/set-3s.jpg', 'services/set-4s.jpg', 'services/set-5s.jpg', '', '', '', '');
INSERT INTO services_servicedetail (id, name, icon_1, icon_2, image_1, image_10, image_2, image_3, image_4, image_5, image_6, image_7, image_8, image_9, short_description, slug, text_1, text_2, title_1, title_2, banner, thumb_1, thumb_10, thumb_2, thumb_3, thumb_4, thumb_5, thumb_6, thumb_7, thumb_8, thumb_9) VALUES (9, 'Отделка', 'icons/s2-icon-5.png', 'icons/s2-icon-hover-5.png', 'services/ot-1b.jpg', '', 'services/ot-2b.jpg', 'services/ot-3b.jpg', 'services/ot-4b.jpg', 'services/ot-5b.jpg', '', '', '', '', 'Отделка придает помещению законченный вид, чтобы оно отвечало эстетическим требованиям.', 'otdelka', 'На завершающем этапе строительства, когда фундамент, несущие конструкции и перекрытия сооружены, начинаются отделочные работы. На первый взгляд, их проводят для того, чтобы придать сооружению законченный вид, чтобы оно отвечало определенным эстетическим требованиям.', '', 'Внутренняя и внешняя отделка', '', 'banners/otdelka.jpg', 'services/ot-1s.jpg', '', 'services/ot-2s.jpg', 'services/ot-3s.jpg', 'services/ot-4s.jpg', 'services/ot-5s.jpg', '', '', '', '');
INSERT INTO services_servicepage (id, title, subtitle, text, bottom_title, bottom_text, banner, image) VALUES (1, '<h2>Есть ли <br class="title_br"> разница?</h2>', 'Плюсы "ТимВитСтроя"', '<p>Когда вы только начинаете изучать рынок строительных услуг и собираете первую информацию об организациях, уже можно отметать опасные варианты. Очевидно, что сезонные бригады, неофициальные подрядчики и откровенные шабашники вообще не должны рассматриваться в качестве квалифицированных строителей. А для частного, да и вообще любого, строительства нужны именно профессионалы. Выбор остается за вами! Не так страшны небольшие технические погрешности в ходе работ, как сотрудничество со строителями, не заслуживающими доверия.</p>', 'Качество услуг', 'Строительный контроль является одной из форм обязательной оценки соответствия зданий и сооружений нормам и правилам. Под строительным контролем следует понимать контроль за выполнением работ, состоянием конструкций и участков сетей инженерно-технического обеспечения, оказывающих влияние на безопасность объекта. Строительный контроль проводится в процессе строительства, реконструкции и капитального ремонта объектов. Такой контроль является нашей прерогативой!', 'banners/serv_banner.jpg', 'services/serv_image.jpg');
